shared_text:
Wicomico County Public Schools added 23 new photos.
September 9 at 5:09 PM ·

With the new school year underway, it was time to celebrate the 2020-2021 Wicomico Teacher of the Year, Hemalatha Bhaskaran, with some special gifts. In a small gathering at the James M. Bennett High Shipyard, the JMB Environmental Science teacher was presented with her Teacher of the Year plaque, a Golden Apple from the Board of Education, and a car from the Hertrich Family of Automobile Dealerships to use throughout her year of representing Wicomico teachers.And while that was happening, the Maryland State Department of Education was announcing her as one of the seven finalists for Maryland Teacher of the Year, to be named in a virtual TV ceremony Oct. 8. Good luck Mrs. Bhaskaran!

@wcboeJMB
@HertrichFamily

